import { useState } from 'react';

export default function PoS({prodList}){
    const [name, setName] = useState('')

    
    return(
        <Container className="d-flex justify-content-center">
            Enter Your Name: <br/>
            <input 
                value={name}
                onChange={e => setName(e.target.value)}
            /><br/>
            <button onClick>Enter</button>
            {/* <h1>Products</h1> */}
            
        </Container>
    )
}
